        position: relative;
        box-sizing: border-box;
        background-color: #CCF0FF;
        padding: 65px $padding 150px $padding;
        margin-left: -$padding;
        width: 100vw;
        @include for-desktops {
            @supports (display: grid) {
                width: 754px;
            }
        }
