    & section h3 {
        color: rgba(0, 90, 156, 0.9);
        font-weight: 600;
        font-size: 24px;
        margin: 0;
        margin-bottom: 40px;
    } 

    & section ul {
        text-align: left;
        padding: 0;
        margin: 0;
        list-style: none;
        max-width: 430px;
        margin-left: auto;
        margin-right: auto;
    }

    & section li {
        padding-left: 35px;
        font-size: 18px;
        font-weight: 500;
        color: rgba(0, 90, 156, 0.9);
        margin-bottom: 28px;
        position: relative;
    }

    & section li::before {
        position: absolute;
        content: "\f005"; /* FontAwesome Unicode */
        font-family: 'Font Awesome 5 Free';
        font-style: normal;
        font-variant: normal;
        text-rendering: auto;
        -webkit-font-smoothing: antialiased;
        font-weight: 900;
        display: flex;
        align-items: center;
        justify-content: center;
        left: 0;
        background-color: #fff;
        width: 20px;
        height: 20px;
        border-radius: 50%;
