        left: 50%;
        transform: translateX(-50%);
        position: absolute;
        width: 250px;
        height: auto;
        margin-left: auto;
        margin-right: auto;
        @include for-desktops {
            display: none;
        }

        & img {
            width: 100%;
        }
    }
}

